B.aag=new A.a3("- Raz\xf3n Social: Instituto Nacional de los Espacio Acu\xe1ticos (INEA) \n- R.I.F.: G-200021411 \n- Domicilio Principal: Av. Orinoco entre Perij\xe1 y Mucuch\xedes, edificio INEA.",null,B.F,B.l,null,null,null,null,null)
B.aa_=new A.a3("A trav\xe9s de este documento, la aplicaci\xf3n INEA Te Escucha recoge su Pol\xedtica de Privacidad. \n\n Nos aseguramos de que los datos de car\xe1cter personal proporcionados por nuestros usuarios y potenciales usuario tengan la m\xe1xima reserva y protecci\xf3n. \n\n Respetamos la confidencialidad y privacidad de la informaci\xf3n privada y datos personales de nuestros usuarios y de todas aquellas personas interesadas en los servicios y/o productos ofrecidos a trav\xe9s de nuestra plataforma web.",null,B.F,B.l,null,null,null,null,null)
B.D=new A.dD(null,20,null,null)
B.a98=new A.a3("Pol\xedtica de Privacidad para INEA Te Escucha",null,B.E,B.l,null,null,null,null,null)
B.aaq=new A.a3("Para INEA Te Escucha la pol\xedtica de privacidad tiene como objeto informarle acerca de c\xf3mo recopilamos, seguimos y compartimos su informaci\xf3n y de c\xf3mo nos comprometemos a la protecci\xf3n de sus datos. Esta informaci\xf3n es importante, esperamos que dedique el tiempo necesario a leerla. Su privacidad es muy importante para nosotros. Esta pol\xedtica puede ser modificada, ya sea por el uso de nuevas tecnolog\xedas de procesamiento de informaci\xf3n, o cambios que pudi\xe9ramos introducir en nuestra aplicaci\xf3n y a nuestras herramientas de comunicaci\xf3n. Todas las veces que modifiquemos esta pol\xedtica lo comunicaremos, de manera que pueda estar siempre al tanto de la misma. No limitaremos los derechos que le corresponden con arreglo a la presente pol\xedtica de privacidad sin su expreso consentimiento.",null,B.F,B.l,null,null,null,null,null)
B.aaS=new A.a3("Confidencialidad del tratamiento de los datos personales",null,B.E,B.l,null,null,null,null,null)
B.a8Z=new A.a3("Aseguramos la confidencialidad de los datos personales de los usuarios que se registren en la aplicaci\xf3n INEA Te Escucha mediante el formulario establecido para esos efectos.Sin perjuicio de sus facultades legales, s\xf3lo efectuaremos tratamiento de datos personales respecto a aquellos que han sido entregados voluntariamente por los usuarios en los referidos formularios.",null,B.F,B.l,null,null,null,null,null)
B.aaR=new A.a3("Seguridad de su informaci\xf3n personal",null,B.E,B.l,null,null,null,null,null)
B.aay=new A.a3("Sus datos personales le corresponden s\xf3lo a usted y INEA Te Escucha es responsable de no revelar ninguna clase de informaci\xf3n que le pertenezca. Para ello, se usan los sistemas m\xe1s avanzados y se actualizan constantemente para asegurar que no existan accesos no autorizados. Como excepci\xf3n s\xf3lo compartiremos sus datos personales por motivos legales. En este caso, s\xf3lo si consideramos de buena fe que existe una necesidad razonable de acceder a dichos datos o utilizarlos, ya sea para cumplir con cualquier legislaci\xf3n o normativa, o atender a requerimientos legales, para cumplir con investigaciones de posibles infracciones y para proteger los derechos de los usuarios en la medida exigida por la legislaci\xf3n aplicable.",null,B.F,B.l,null,null,null,null,null)
B.a9n=new A.a3("Obtenci\xf3n de su informaci\xf3n",null,B.E,B.l,null,null,null,null,null)
B.aap=new A.a3("Sus datos personales consignados en esta aplicaci\xf3n son suministrados por usted mismo, haciendo uso entero de su libertad. La informaci\xf3n aqu\xed almacenada s\xf3lo comprende datos b\xe1sicos ingresados mediante formularios de contacto u otros similares.",null,B.F,B.l,null,null,null,null,null)
B.aaN=new A.a3("Uso de la informaci\xf3n recogida",null,B.E,B.l,null,null,null,null,null)
B.a9P=new A.a3("Los datos personales de los usuarios ser\xe1n utilizados para el cumplimiento de los fines indicados en el formulario correspondiente y siempre dentro de la competencia y atribuciones de INEA Te Escucha, conectar con las gerencias u oficinas del INEA que debe atender cada caso. Al proporcionarnos sus datos personales, estando de acuerdo con la pol\xedtica de privacidad aqu\xed consignada, nos autoriza para el siguiente uso y tratamiento de su informaci\xf3n:",null,B.F,B.l,null,null,null,null,null)
B.a9R=new A.a3("1. Proporcionar nuestros productos, lo que incluye la actualizaci\xf3n, protecci\xf3n y soluci\xf3n de problemas, as\xed como facilitar mejoras en nuestros procesos internos. Tambi\xe9n incluye compartir datos, cuando sea necesario para proporcionar el servicio o realizar las transacciones que solicite. \n\n 2. Para el fin mismo por lo cual se ha suministrado; \n\n 3. Para considerarlo dentro de nuestras estad\xedsticas de tr\xe1fico, informaci\xf3n estad\xedstica elaborada a partir de los datos personales de los usuarios, sin el consentimiento expreso del titular, aunque de dichos datos no sea posible identificar individualmente a los titulares y; \n\n 4. Para orientar mejor los servicios aqu\xed ofrecidos y valorarlos a su criterio.",null,B.F,B.l,null,null,null,null,null)
B.aaj=new A.a3("Lo que el usuario deber\xeda saber de un vistazo",null,B.E,B.l,null,null,null,null,null)
B.aa4=new A.a3("La aplicaci\xf3n solo est\xe1 destinada atender las quejas y reclamos, sugerencias y denuncias. La utilizaci\xf3n de la aplicaci\xf3n est\xe1 restringida en funci\xf3n de la edad: para acceder a INEA Te Escucha y utilizarlos es preciso ser mayor de edad seg\xfan la ley aplicable.\n\n Ante cualquier solicitud o denuncia el instituto se comunicar\xe1 con el usuario a trav\xe9s de los datos proporcionado al momento del registro, en tal sentido se le recomienda colocar los datos fidedignos, para as\xed contactarlo y atenderlo de manera directa.\n\n Ni la aplicaci\xf3n ni el Instituto le solicitara por correo o por ninguna v\xeda, datos personales tales como claves o informaci\xf3n privada.",null,B.F,B.l,null,null,null,null,null)
B.a9v=new A.a3("Condiciones de uso",null,B.E,B.l,null,null,null,null,null)
B.aaC=new A.a3("Las condiciones de uso detalladas se aplicar\xe1n de forma general al uso de la aplicaci\xf3n. Al utilizar INEA Te Escucha, los usuarios confirman que cumplen los siguientes requisitos.\n\n1.- Los usuarios deber\xe1n entrar en la categor\xeda de denunciante. \n\n2.- Los usuarios deber\xe1n ser mayores de edad de acuerdo con la ley.",null,B.F,B.l,null,null,null,null,null)
